import React, { Component } from 'react';
//import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
//import axios from 'axios';
import './App.css';
import Login from './Components/Login'
import Signup from './Components/Signup'

class App extends Component {

state = {
  logInLoading: false,
  logInDone: false, 
  logInError: false,

  logOutLoading: false,
  logOutDone: false, 
  logOutError: false,

  signUpLoading: false,
  signUpDone: false, 
  signUpError: false,

  userInfo: {}
};


render(){
  const { logInDone, userInfo } = this.state;
  return (
    <div className= "App">
      <header className="오늘의 디저트">
        <Login />
        <Route
          exact
          path="/signup"
            render={() => 
              <Signup
              logInDone = {logInDone} />}
                />
        <p> 비회원으로 시작 </p>
      </header>
    </div>
  );
}
}

export default App;
